import React from "react";
import { 
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBCardImage,
    MDBCardFooter,
    MDBRipple,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";




export function ProfileCard(props) {

    const {cardPicUrl,countryName,id} = props

    const whenDragStart = function(ev) {
        ev.dataTransfer.setData("text", ev.target.id);
    }

    const whenDragOver = function(ev) {
        ev.preventDefault()
    }

    const onDrop = (event) => {
        const cardId = event.dataTransfer.getData('text/plain');
        const card = document.getElementById(cardId);
        event.target.appendChild(card);
      };



    return(
        <MDBCard id={id} className="profileCard-card" draggable="true" onDragStart = {(e) => whenDragStart(e)} onDragOver = {(e) => whenDragOver(e)}
            alignment='center'>
            <MDBCardImage className="" src={cardPicUrl} position="top" fluid alt='...' />
            <MDBCardFooter>{countryName}</MDBCardFooter>
        </MDBCard>
    )

}
